import React, { Component } from 'react';
import { Redirect } from "react-router-dom";

class CreateAccount extends Component {
  constructor(props) {
    super(props);
    this.state = {
      redirect: null,
      userid: null
    };
    this.createAccount = this.createAccount.bind(this);
  }
  createAccount() {
    console.log('createaccount')
    this.setState({ redirect: '/createaccount' });
  }
  render() {
    if (this.state.redirect) {
      return <Redirect to={this.state.redirect} />
    }
    return (
      <div>
        <div>Create Account</div>
        <input placeholder="Enter email" type="text" /><br />
        <input placeholder="Enter password" type="password" /><br /><br />
        <button onClick={this.userLoginFunction}>Log In</button><br /><br />
        <button onClick={this.goToCreateAccount}>Create Account</button>
      </div>
    );
  }
}

export default CreateAccount;
